--GIVE NECESSARY PERMISSIONS TO Operator USER(access_management db)
--*************************************************************
	SELECT  p.`id`, me.`id` FROM `policy` p, `module_endpoints` me
	WHERE me.`module` not in ('REGISTER','IMPORTINVENTORY','INVENTORY','CREATE_CONTRACT','SURVEY','VOUCHER','GROUP','TRIP','ACTIVITY','KYC','ORDER')
	AND p.`name` IN ('Operator Policy');

--GIVE NECESSARY PERMISSIONS TO RESELLERS DISTRIBUTOR, SE, POS (access_management db)
--*************************************************************
    SELECT  p.`id`, me.`id` FROM `policy` p, `module_endpoints` me
    WHERE me.`module` in ('ACCESS','CONTRACT','ACCOUNT','PRODUCT','RESELLER','TRANSACTION','Template Management','IMS bridge') AND p.`name` in ('Reseller Policy');


